	.ResumeDetail_ResumeDetail__body__toolbar__lang_select__GehjE {
		background: none;
		position: relative;
		width: 100%;
		min-width: 98px;
		height: 100%;
		padding-left: 37px;
		border: #e0e0e0;
		background-color: transparent;
		box-shadow: none;
	}
	.icon-cheveron-right {
		right: 0;
		font-size: 18px;
		color: #666;
		position: absolute;
		top: 10px;
	}
	.ResumeDetail_ResumeDetail__body__toolbar__otherBtns__ENutv {
		vertical-align: middle;
		display: flex;
	}
	.GuideButton_GuideButton__b8VUj.GuideButton_desktop__YbvRO {
		margin-right: 30px;
		display: flex;
		align-items: center;
		justify-content: flex-end;
		background-color: #fff;
	}
	.GuideButton_GuideButton__item__t2_VX {
		display: flex;
		justify-content: center;
		align-items: center;
		span {
			font-size: 14px;
			padding: 0.2em 0.6em 0.3em;
			font-weight: 600;
		}
	}
	.GuideButton_GuideButton__item_button__Gfk73 {
		padding-right: 5px !important;
		height: 40px;
		font-size: 15px;
		color: #36f;
		padding: 6px 8px;
		position: relative;
		display: inline-flex;
		align-items: center;
		justify-content: center;
		vertical-align: middle;
		min-width: 64px;
		box-sizing: border-box;
		border-radius: 25px;
		font-weight: 700;
		line-height: normal;
