			width: 1px;
			height: 14px;
			background-color: #ccc;
			position: absolute;
			left: 0;
		}
	}
	.GuideButton_GuideButton__item_toggle_btn__XnsVP {
		margin-bottom: 3px;
		position: relative;
		display: inline-block;
		width: 56px;
		height: 30px;
	}
	.ToggleButton_ToggleButton_input__5YNX2 {
		opacity: 0;
		width: 0;
		height: 0;
	}
	.GuideButton_GuideButton__item__t2_VX span {
		font-size: 14px;
	}
	<style > .ToggleButton_ToggleButton_slider__tXkn6 {
		position: absolute;
		cursor: pointer;
		top: 0;
		left: 0;
		right: 0;
		bottom: 0;
		background-color: #f2f4f7;
		-webkit-transition: 0.4s;
		transition: 0.4s;
		border-radius: 15px;
		border: 1px solid #ececec;
	}
`;
export default ResumeDetailToolbar;
